import React, { useState, useContext } from "react";
import { Link, useLocation } from "react-router-dom";

const NavBar = (props) => {
    const handlesidebar = () => {
        document.body.classList.toggle("mini-sidebar");
    };
    const onMenuClik = () => {
        props.onMenuClick();
    };

    const location = useLocation();


    return(
        <div className="header" style={{ right: "0px" }}>
            {/* Logo */}
            <div className="header-left">

            </div>
            {/* /Logo */}
            <Link
                id="toggle_btn"
                to="#"
                style={{
                    display: location.pathname.includes("tasks")
                        ? "none"
                        : location.pathname.includes("compose")
                            ? "none"
                            : "",
                }}
                onClick={handlesidebar}>
                <span className="bar-icon">
                <span />
                <span />
                <span />
                </span>
            </Link>
            {/* Header Title */}
            <div className="page-title-box">
                <h3>Blossom Health</h3>
            </div>
            {/* /Header Title */}
            <Link
                id="mobile_btn"
                className="mobile_btn"
                to="#"
                onClick={() => onMenuClik()}>
                <i className="fa fa-bars" />
            </Link>
            {/* Header Menu */}
            <ul className="nav user-menu">
                {/* Search */}
                <li className="nav-item">
                    <div className="top-nav-search">
                        {/*<Link to="#" className="responsive-search">*/}
                        {/*    <i className="fa fa-search"/>*/}
                        {/*</Link>*/}
                        {/* <form>
                            <input
                                className="form-control"
                                type="text"
                                placeholder="Search here"
                            />
                            <button className="btn" type="submit">
                                <i className="fa fa-search" />
                            </button>
                        </form> */}
                    </div>
                </li>
                {/* /Search */}
                {/* Flag */}
                {/* <li className="nav-item dropdown has-arrow flag-nav">
                    <Link
                        className="nav-link dropdown-toggle"
                        data-bs-toggle="dropdown"
                        to="#"
                        role="button">
                        <img src={lnEnglish} alt="#" height={20} /> <span>English</span>
                    </Link>
                    <div className="dropdown-menu dropdown-menu-end dropdown-menu-right">
                        <Link to="#" className="dropdown-item">
                            <img src={lnEnglish} alt="" height={16} /> English
                        </Link>
                        <Link to="#" className="dropdown-item">
                            <img src={lnFrench} alt="" height={16} /> French
                        </Link>
                        <Link to="#" className="dropdown-item">
                            <img src={lnSpanish} alt="" height={16} /> Spanish
                        </Link>
                        <Link to="#" className="dropdown-item">
                            <img src={lnGerman} alt="" height={16} /> German
                        </Link>
                    </div>
                </li> */}
                {/* /Flag */}
                {/* Notifications */}
                <li className="nav-item dropdown">
                    <Link
                        to="#"
                        className="dropdown-toggle nav-link"
                        data-bs-toggle="dropdown"
                        onClick={() => setNotifications(!notification)}>
                        <i className="fa-regular fa-bell"/>{" "}
                        <span className="badge badge-pill">3</span>
                    </Link>
                    <div
                        className={`dropdown-menu dropdown-menu-end notifications ${
                            notification ? "show" : ""
                        }`}>
                        <div className="topnav-dropdown-header">
                            <span className="notification-title">Notifications</span>
                            <Link
                                to="#"
                                onClick={() => setNotifications(false)}
                                className="clear-noti">
                                {" "}
                                Clear All{" "}
                            </Link>
                        </div>
                        <div className="noti-content">
                            <ul className="notification-list">
                                {data.map((val, index) => {
                                    return (
                                        <li className="notification-message" key={index}>
                                            <Link
                                                onClick={() =>
                                                    localStorage.setItem("minheight", "true")
                                                }
                                                to="/app/administrator/activities">
                                                <div className="media d-flex">
                                                  <span className="avatar flex-shrink-0">
                                                    <img alt="" src={val.image}/>
                                                  </span>
                                                    <div className="media-body">
                                                        <p className="noti-details">
                                                            <span className="noti-title">{val.name}</span>{" "}
                                                            {val.contents}{" "}
                                                            <span className="noti-title">
                                                                {val.contents_2}
                                                              </span>
                                                        </p>
                                                        <p className="noti-time">
                                                          <span className="notification-time">
                                                            {val.time}
                                                          </span>
                                                        </p>
                                                    </div>
                                                </div>
                                            </Link>
                                        </li>
                                    );
                                })}
                            </ul>
                        </div>
                        <div className="topnav-dropdown-footer">
                            <Link
                                onClick={() => localStorage.setItem("minheight", "true")}
                                to="/app/administrator/activities">
                                View all Notifications
                            </Link>
                        </div>
                    </div>
                </li>
                {/* /Notifications */}


                {/* GoogleCalendar */}
                {/*<li className="nav-item">*/}
                {/*    <Link*/}
                {/*        to="/calendar"*/}
                {/*        className="nav-link">*/}
                {/*        <i className="fa-regular fa-calendar"/>{" "}*/}
                {/*    </Link>*/}
                {/*</li>*/}
                {/* / GoogleCalendar */}

                <li className="nav-item dropdown has-arrow main-drop">
                    <Link
                        to="#"
                        className="dropdown-toggle nav-link"
                        data-bs-toggle="dropdown"
                    >
                      <span className="user-img me-1">
                        <img
                            src={`https://api.dicebear.com/6.x/initials/svg?seed=${getDisplayName(userRole)}`}
                            alt="user avatar"
                        />
                        <span className="status online"/>
                      </span>
                        <span>{getDisplayName(userRole) || "User"}</span>
                    </Link>

                    <div className="dropdown-menu dropdown-menu-end">
                        <Link className="dropdown-item" to="/profile/employee-profile">
                            My Profile
                        </Link>
                        <Link className="dropdown-item" to="/settings/companysettings">
                            Settings
                        </Link>
                        <Link className="dropdown-item" to="/">
                            Logout
                        </Link>
                    </div>
                </li>
            </ul>
            {/* /Header Menu */}
            {/* Mobile Menu */}
            <div className="dropdown mobile-user-menu">
                <Link
                    to="#"
                    className="nav-link dropdown-toggle"
                    data-bs-toggle="dropdown"
                    aria-expanded="false">
                    <i className="fa fa-ellipsis-v" />
                </Link>
                <div className="dropdown-menu dropdown-menu-end dropdown-menu-right">
                    <Link className="dropdown-item" to="/app/profile/employee-profile">
                        My Profile
                    </Link>
                    <Link className="dropdown-item" to="/settings/companysetting">
                        Settings
                    </Link>
                    <Link className="dropdown-item" to="/">
                        Logout
                    </Link>
                </div>
            </div>
            {/* /Mobile Menu */}
        </div>
        // </div>
    );
}

export default NavBar;
